import React from "react";

export default function Refecto({ data }) {
  const recur = (data) => {
    for (var key in data) {
      if (typeof data[key] === "object" && data[key] !== null) {
        recur(data[key]);
      } else return data[key];
    }
  };

  return <div className="code-block">{recur(data)}</div>;
}
